import Background from './stars.jpg';

var sectionStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: "url(" + { Background } + ")"
};


class Karsilama extends Component {
    render() {
        return (
            <div class="hero-image">
  <div class="hero-text">
    <h1 >I am John Doe</h1>
    <p>And I'm a Photographer</p>
    <button>Hire me</button>
  </div>
</div>
        )
    }
}
export default Karsilama;
